import './App.css';
import Heading from './Heading.jsx';
import Heading2 from './Heading2.jsx';
import SecondHeader from './SecondHeader';
import DownButton from './DownButton';




function App() {
  return (
  <div>
    <div class = "flex h-screen justify-center items-center bg-gradient-to-r from-violet-500 to-fuchsia-500">
      <Heading/>
      <div class = "cursor-pointer mt-96 drop-shadow-2xl animate-bounce	">
        <DownButton/>
      </div>
    </div>

    <div class="flex flex-col h-screen items-center bg-gradient-to-r from-violet-500 to-fuchsia-500">
      <div>
        <SecondHeader/>
      </div>
    </div>
  </div>
  );
}

export default App;
